import React, { Component, Fragment } from 'react'
import { Route  } from 'react-router-dom'

import Nav from '../Nav'
import cat_dog from '../images/cat_dog.png'
import Footer from '../Footer'


import './index.sass'

class Home extends Component {


    handleEditOwner = event => {
        event.preventDefault()
        this.props.history.push('/editOwner')
    }

    handleEditPet = event => {
        event.preventDefault()
        this.props.history.push('/editPet')
    }
    
    handleAppointments = event =>{
        event.preventDefault()
        this.props.history.push('/appointments')
    }

    

    render(){

    return <Fragment>
    <Nav className='fixed'></Nav>
   
    <button onClick={this.handleEditOwner}>Edit Owner</button>
    <button onClick={this.handleEditPet}>Edit Pet</button>
    <button onClick={this.handleAppointments}>Appointments</button>
    <Footer className='fixed'></Footer>
</Fragment>
}

}


export default Home
